import React, { useState } from 'react';
import { Box, Tabs, Tab, Typography, Container } from '@mui/material';
import { OptionChainGrid } from './OptionChain/OptionChainGrid';
import { TradeSummary } from './Trade/TradeSummary';
import { VolatilityAnalysis } from './Analysis/VolatilityAnlaysis';
import { StrategyBuilder } from './Strategy/StrategyBuilder';
import { AccessTokenInput } from './Auth/AccessTokenInput';

interface TabPanelProps {
  children?: React.ReactNode;
  index: number;
  value: number;
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`tabpanel-${index}`}
      aria-labelledby={`tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          {children}
        </Box>
      )}
    </div>
  );
}

const MainContent: React.FC = () => {
  const [value, setValue] = useState(0);

  const handleChange = (event: React.SyntheticEvent, newValue: number) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider', bgcolor: 'background.paper' }}>
        <Tabs
          value={value}
          onChange={handleChange}
          aria-label="trading tabs"
          variant="scrollable"
          scrollButtons="auto"
          sx={{
            '& .MuiTab-root': {
              fontWeight: 'bold',
              fontSize: '0.9rem',
              minWidth: 120,
            }
          }}
        >
          <Tab label="Option Chain" />
          <Tab label="Trade Summary" />
          <Tab label="Volatility Analysis" />
          <Tab label="Strategy Builder" />
          <Tab label="Settings" />
        </Tabs>
      </Box>

      <TabPanel value={value} index={0}>
        <Container maxWidth="xl">
          <OptionChainGrid symbol="NIFTY" />
        </Container>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <Container maxWidth="xl">
          <TradeSummary />
        </Container>
      </TabPanel>
      <TabPanel value={value} index={2}>
        <Container maxWidth="xl">
          <VolatilityAnalysis />
        </Container>
      </TabPanel>
      <TabPanel value={value} index={3}>
        <Container maxWidth="xl">
          <StrategyBuilder />
        </Container>
      </TabPanel>
      <TabPanel value={value} index={4}>
        <Container maxWidth="sm">
          <Box sx={{ p: 3, bgcolor: 'background.paper', borderRadius: 1 }}>
            <Typography variant="h5" gutterBottom align="center">
              Settings
            </Typography>
            <Typography variant="subtitle1" gutterBottom>
              Access Token
            </Typography>
            <AccessTokenInput />
          </Box>
        </Container>
      </TabPanel>
    </Box>
  );
};

export default MainContent;
